func TestSDK_DirectionDrivingV3(t *testing.T) {
	type fields struct {
		opt        *AmapOpt
		httpClient *http.Client
	}
	type args struct {
		waypoints [][2]float32
	}
	opt := fields{
		opt: &AmapOpt{
			BasePath: "https://restapi.amap.com",
			Output:   "json",
			Batch:    16,
			Key:      "8011e4f922fbfdc87874848d256baa09",
			Debug:    false,
			Strategy: "1",
			Method:   1,
		},
		httpClient: http.DefaultClient,
	}
	var tests = []struct {
		name    string
		fields  fields
		args    args
		wantErr bool
	}{
		{name: "test1",
			fields:  opt,
			args:    args{waypoints: [][2]float32{{116.481028, 39.989643}, {116.357483, 39.907234}}},
			wantErr: false,
		},
		{name: "test2",
			fields: opt,
			args: args{waypoints: [][2]float32{
				{116.4459, 39.8696}, {116.4015, 39.8999}, {116.4023, 39.9002}, {116.4041, 39.9002}, {116.4051, 39.9003}, {116.4059, 39.9003}, {116.4066, 39.8962}, {116.4066, 39.8963},
				{116.4066, 39.896}, {116.4067, 39.8968}, {116.4068, 39.8933}, {116.4068, 39.8963}, {116.4068, 39.8965}, {116.4068, 39.8966},
				{116.4077, 39.9003}, {116.4092, 39.9005}, {116.4128, 39.9004}, {116.4158, 39.9006}, {116.4287, 39.9004}, {116.4309, 39.9003},
				{116.4641, 39.8659}, {116.4459, 39.8696}, {116.4459, 39.8696}, {116.4459, 39.8696}}},
			wantErr: false,
		},
	}
	for _, tt := range tests {
		t.Run(tt.name, func(t *testing.T) {
			s := &SDK{
				opt:        tt.fields.opt,
				httpClient: tt.fields.httpClient,
			}
			result := DirectionDrivingV3(s, "1", 7, tt.args.waypoints...)
			if result.Code != 200 {
				t.Errorf("DirectionDrivingV3() error = %v, wantErr %v", result.Message, tt.wantErr)
			} else {
				t.Logf("DirectionDrivingV3() error = %v, wantErr %v", result.Message, tt.wantErr)
			}

		})
	}
}

